bool is_palindrome(const string& str) {
    // Test if given string is a palindrome
    string s(str.rbegin(), str.rend());
    return s == str;
}

string make_palindrome(const string& str) {
    // Find the shortest palindrome that begins with a supplied string
    if (str.empty()) {
        return "";
    }

    int beginning_of_suffix = 0;

    while (!is_palindrome(str.substr(beginning_of_suffix))) {
        beginning_of_suffix++;
    }

    string prefix = str.substr(0, beginning_of_suffix);
    reverse(prefix.begin(), prefix.end());

    return str + prefix;
}


#undef NDEBUG
#include<assert.h>
int main(){
    assert (make_palindrome("") == "");
    assert (make_palindrome("x") == "x");
     assert (make_palindrome("xyz") == "xyzyx");
     assert (make_palindrome("xyx") == "xyx") ;
     assert (make_palindrome("jerry") == "jerryrrej");
}

