string string_xor(string a, string b) {
    string result = "";
    for (size_t i = 0; i < a.length(); ++i) {
        // Perform XOR on each pair of characters
        if (a[i] == b[i]) {
            result += '0';
        } else {
            result += '1';
        }
    }
    return result;
}

