vector<string> separate_paren_groups(string paren_string) {
    vector<string> result;
    string current_string;
    int current_depth = 0;

    for (char c : paren_string) {
        if (c == '(') {
            current_depth += 1;
            current_string += c;
        } else if (c == ')') {
            current_depth -= 1;
            current_string += c;

            if (current_depth == 0) {
                result.push_back(current_string);
                current_string.clear();
            }
        }
    }

    return result;
}


