vector<int> intersperse(vector<int> numbers, int delimiter) {
    if (numbers.empty()) {
        return {};
    }

    vector<int> result;
    for (size_t i = 0; i < numbers.size() - 1; ++i) {
        result.push_back(numbers[i]);
        result.push_back(delimiter);
    }
    result.push_back(numbers.back());

    return result;
}

// Function to test the intersperse function
void test_intersperse() {
    vector<int> test1 = intersperse({}, 4);
    vector<int> expected1 = {};
    assert(test1 == expected1);

    vector<int> test2 = intersperse({1, 2, 3}, 4);
    vector<int> expected2 = {1, 4, 2, 4, 3};
    assert(test2 == expected2);

    cout << "All tests passed!" << endl;
}


