// Helper function to parse a single group of nested parentheses
int parse_paren_group(const string& s) {
    int depth = 0;
    int max_depth = 0;
    for (char c : s) {
        if (c == '(') {
            depth += 1;
            max_depth = max(depth, max_depth);
        } else if (c == ')') {
            depth -= 1;
        }
    }
    return max_depth;
}

vector<int> parse_nested_parens(string paren_string) {
    vector<int> result;
    stringstream ss(paren_string);
    string group;

    // Split the input string by spaces and process each group
    while (getline(ss, group, ' ')) {
        if (!group.empty()) {
            result.push_back(parse_paren_group(group));
        }
    }

    return result;
}

// Function to test the solution
void test_parse_nested_parens() {
    string input = "(()()) ((())) () ((())()())";
    vector<int> expected_output = {2, 3, 1, 3};
    vector<int> output = parse_nested_parens(input);

    if (output == expected_output) {
        cout << "Test passed." << endl;
    } else {
        cout << "Test failed." << endl;
    }
}


