vector<float> find_closest_elements(vector<float> numbers) {
    // Sort the numbers to make finding the closest pair easier
    sort(numbers.begin(), numbers.end());

    // Initialize variables to store the closest pair and the minimum distance
    float min_distance = numeric_limits<float>::max();
    vector<float> closest_pair(2);

    // Iterate through the sorted list to find the closest pair
    for (size_t i = 0; i < numbers.size() - 1; ++i) {
        float current_distance = abs(numbers[i + 1] - numbers[i]);
        if (current_distance < min_distance) {
            min_distance = current_distance;
            closest_pair[0] = numbers[i];
            closest_pair[1] = numbers[i + 1];
        }
    }

    return closest_pair;
}

