int how_many_times(string str, string substring) {
    int times = 0;
    int sub_len = substring.length();

    // Loop through the string from the start to the position where the substring can still fit
    for (int i = 0; i <= str.length() - sub_len; ++i) {
        // Check if the substring starting at the current index matches the given substring
        if (str.substr(i, sub_len) == substring) {
            times += 1;
        }
    }

    return times;
}


