vector<int> parse_music(string music_string) {
    // Map of note symbols to their corresponding beats
    const unordered_map<string, int> note_map = {
        {"o", 4},
        {"o|", 2},
        {".|", 1}
    };

    vector<int> beats;
    stringstream ss(music_string);
    string note;

    // Split the input string by spaces and process each note
    while (ss >> note) {
        // Find the corresponding number of beats for the note
        auto it = note_map.find(note);
        if (it != note_map.end()) {
            beats.push_back(it->second);
        }
    }

    return beats;
}

