vector<int> factorize(int n) {
    vector<int> factors;
    int i = 2;
    while (i <= sqrt(n) + 1) {
        if (n % i == 0) {
            factors.push_back(i);
            n /= i;
        } else {
            i += 1;
        }
    }
    if (n > 1) {
        factors.push_back(n);
    }
    return factors;
}

