vector<float> rescale_to_unit(vector<float> numbers) {
    // Find the minimum and maximum values in the vector
    float min_number = *min_element(numbers.begin(), numbers.end());
    float max_number = *max_element(numbers.begin(), numbers.end());

    // Apply the linear transformation to each element
    vector<float> transformed_numbers;
    for (float x : numbers) {
        float transformed_value = (x - min_number) / (max_number - min_number);
        transformed_numbers.push_back(transformed_value);
    }

