string sort_numbers(string numbers) {
    // Mapping words to their corresponding integer values
    map<string, int> value_map = {
        {"zero", 0},
        {"one", 1},
        {"two", 2},
        {"three", 3},
        {"four", 4},
        {"five", 5},
        {"six", 6},
        {"seven", 7},
        {"eight", 8},
        {"nine", 9}
    };

    // Split the input string into a vector of words
    stringstream ss(numbers);
    vector<string> words;
    string word;
    while (ss >> word) {
        words.push_back(word);
    }

    // Sort the words based on their integer values
    sort(words.begin(), words.end(), [&](const string& a, const string& b) {
        return value_map[a] < value_map[b];
    });

    // Join the sorted words back into a single string
    string result;
    for (size_t i = 0; i < words.size(); ++i) {
        result += words[i];
        if (i < words.size() - 1) {
            result += " ";
        }
    }

    return result;
}


