vector<int> remove_duplicates(vector<int> numbers) {
    // Create an unordered_map to count the occurrences of each element
    unordered_map<int, int> count;
    for (int num : numbers) {
        count[num]++;
    }

    // Use a vector to store the result, keeping the order of elements
    vector<int> result;
    for (int num : numbers) {
        if (count[num] == 1) {
            result.push_back(num);
        }
    }

    return result;
}

