bool is_prime(int p) {
    if (p < 2) {
        return false;
    }
    for (int k = 2; k <= sqrt(p); ++k) {
        if (p % k == 0) {
            return false;
        }
    }
    return true;
}

int prime_fib(int n) {
    vector<int> f = {0, 1};
    while (true) {
        int next_fib = f[f.size() - 1] + f[f.size() - 2];
        f.push_back(next_fib);
        if (is_prime(next_fib)) {
            --n;
        }
        if (n == 0) {
            return next_fib;
        }
    }
}


