    // Extract even and odd indexed elements
    for (size_t i = 0; i < l.size(); ++i) {
        if (i % 2 == 0) {
            evens.push_back(l[i]);
        } else {
            odds.push_back(l[i]);
        }
    }

    // Sort the even indexed elements
    sort(evens.begin(), evens.end());

    // Reconstruct the result vector
    vector<float> ans;
    size_t even_idx = 0, odd_idx = 0;
    for (size_t i = 0; i < l.size(); ++i) {
        if (i % 2 == 0) {
            ans.push_back(evens[even_idx++]);
        } else {
            ans.push_back(odds[odd_idx++]);
        }
    }

    return ans;
}

