float median(vector<float> l) {
    // Sort the vector
    sort(l.begin(), l.end());

    int n = l.size();
    if (n % 2 == 1) {
        // If the size of the vector is odd, return the middle element
        return l[n / 2];
    } else {
        // If the size of the vector is even, return the average of the two middle elements
        return (l[n / 2 - 1] + l[n / 2]) / 2.0;
    }
}


