vector<int> strange_sort_list(vector<int> lst) {
    vector<int> res;
    bool switch_flag = true;

    while (!lst.empty()) {
        // Find the minimum or maximum value based on the switch flag
        auto it = switch_flag ? min_element(lst.begin(), lst.end()) : max_element(lst.begin(), lst.end());

        // Append the found value to the result vector
        res.push_back(*it);

        // Remove the found value from the original list
        lst.erase(it);

        // Toggle the switch flag
        switch_flag = !switch_flag;
    }

    return res;
}

// Function to test the strange_sort_list function
void test_strange_sort_list() {
    vector<int> test1 = {1, 2, 3, 4};
    vector<int> expected1 = {1, 4, 2, 3};
    assert(strange_sort_list(test1) == expected1);

    vector<int> test2 = {5, 5, 5, 5};
    vector<int> expected2 = {5, 5, 5, 5};
    assert(strange_sort_list(test2) == expected2);

    vector<int> test3 = {};
    vector<int> expected3 = {};
    assert(strange_sort_list(test3) == expected3);

    cout << "All tests passed!" << endl;
}


