int search(vector<int> lst) {
    // Find the maximum value in the list to determine the size of the frequency array
    int max_val = *max_element(lst.begin(), lst.end());

    // Initialize the frequency array with zeros
    vector<int> frq(max_val + 1, 0);

    // Count the frequency of each integer in the list
    for (int i : lst) {
        frq[i]++;
    }

    // Initialize the answer to -1
    int ans = -1;

    // Iterate through the frequency array to find the greatest valid integer
    for (int i = 1; i <= max_val; i++) {
        if (frq[i] >= i) {
            ans = i;
        }
    }

    // Return the result
    return ans;
}

