int hex_key(string num) {
    // Define the prime hexadecimal digits
    const string primes = "2357BD";

    // Initialize the counter for prime digits
    int total = 0;

    // Iterate through each character in the input string
    for (int i = 0; i < num.length(); ++i) {
        // Check if the current character is in the list of prime digits
        if (primes.find(num[i]) != string::npos) {
            total += 1;
        }
    }

    // Return the total count of prime hexadecimal digits
    return total;
}


