string decimal_to_binary(int decimal) {
    // Convert the decimal number to binary using bitset
    string binary = bitset<32>(decimal).to_string();

    // Find the first '1' to trim leading zeros
    size_t first_one = binary.find('1');
    if (first_one != string::npos) {
        binary = binary.substr(first_one);
    } else {
        binary = "0"; // Handle the case when the decimal is 0
    }

    // Add "db" at the beginning and end of the binary string
    return "db" + binary + "db";
}


#undef NDEBUG
#include<assert.h>
int main(){
    assert (decimal_to_binary(0) == "db0db");
    assert (decimal_to_binary(32) == "db100000db");
    assert (decimal_to_binary(103) == "db1100111db");
    assert (decimal_to_binary(15) == "db1111db");

}

