bool is_happy(string s) {
    // Check if the length of the string is less than 3
    if (s.length() < 3) {
        return false;
    }

    // Iterate through the string to check every set of 3 consecutive characters
    for (int i = 0; i < s.length() - 2; ++i) {
        // Check if any of the three consecutive characters are the same
        if (s[i] == s[i + 1] || s[i + 1] == s[i + 2] || s[i] == s[i + 2]) {
            return false;
        }
    }

    // If no set of 3 consecutive characters are the same, return true
    return true;
}

