string solve(int N) {
    int sum = 0;
    // Calculate the sum of the digits
    while (N > 0) {
        sum += N % 10;
        N /= 10;
    }

    // Convert the sum to binary
    string binary = "";
    if (sum == 0) {
        return "0";
    }
    while (sum > 0) {
        binary = to_string(sum % 2) + binary;
        sum /= 2;
    }

    return binary;
}

