string anti_shuffle(string s) {
    // Function to sort a word
    auto sort_word = [](string &word) {
        sort(word.begin(), word.end());
        return word;
    };

    string result;
    string word;
    for (char c : s) {
        if (c == ' ') {
            if (!word.empty()) {
                result += sort_word(word);
                word.clear();
            }
            result += c;
        } else {
            word += c;
        }
    }
    if (!word.empty()) {
        result += sort_word(word);
    }

    return result;
}


