vector<vector<int>> get_row(vector<vector<int>> lst, int x) {
    vector<vector<int>> result;

    // Iterate through each row and column to find the element x
    for (size_t i = 0; i < lst.size(); ++i) {
        for (size_t j = 0; j < lst[i].size(); ++j) {
            if (lst[i][j] == x) {
                result.push_back({static_cast<int>(i), static_cast<int>(j)});
            }
        }
    }

    // Sort by rows in ascending order
    sort(result.begin(), result.end(), [](const vector<int>& a, const vector<int>& b) {
        return a[0] < b[0];
    });

    // Sort columns in descending order within each row
    for (size_t i = 0; i < result.size(); ) {
        size_t j = i + 1;
        while (j < result.size() && result[j][0] == result[i][0]) {
            ++j;
        }
        sort(result.begin() + i, result.begin() + j, [](const vector<int>& a, const vector<int>& b) {
            return a[1] > b[1];
        });
        i = j;
    }

    return result;
}


