string encrypt(string s) {
    string alphabet = "abcdefghijklmnopqrstuvwxyz";
    string out = "";
    for (char c : s) {
        size_t pos = alphabet.find(c);
        if (pos != string::npos) {
            // Calculate the new position with wrapping
            size_t new_pos = (pos + 4) % 26;
            out += alphabet[new_pos];
        } else {
            // Non-alphabetic characters are added as is
            out += c;
        }
    }
    return out;
}


