int is_bored(string S) {
    // Define delimiters for sentences
    const string delimiters = ".?!";

    // Vector to store individual sentences
    vector<string> sentences;

    // Temporary string to hold each sentence
    string temp;

    // Iterate through the string to split it into sentences
    for (char ch : S) {
        if (delimiters.find(ch) != string::npos) {
            if (!temp.empty()) {
                sentences.push_back(temp);
                temp.clear();
            }
        } else {
            temp += ch;
        }
    }

    // Add the last sentence if it exists
    if (!temp.empty()) {
        sentences.push_back(temp);
    }

    // Count the number of sentences that start with "I "
    int count = 0;
    for (const string& sentence : sentences) {
        if (sentence.substr(0, 2) == "I ") {
            count++;
        }
    }

    return count;
}

