// Function to swap case of a character
char swapCase(char c) {
    if (islower(c)) return toupper(c);
    if (isupper(c)) return tolower(c);
    return c;
}

// Function to replace vowels with the letter 2 places ahead
char replaceVowel(char c) {
    string vowels = "aeiouAEIOU";
    string replacements = "cgikmoCGIKMO";
    size_t pos = vowels.find(c);
    if (pos != string::npos) {
        return replacements[pos];
    }
    return c;
}

string encode(string message) {
    // Encode the message
    for (char &c : message) {
        c = swapCase(c);
        c = replaceVowel(c);
    }

    return message;
}

