    set<int> unique_elements(lst.begin(), lst.end());
    vector<int> sorted_elements(unique_elements.begin(), unique_elements.end());

    // Check if there are at least 2 unique elements
    if (sorted_elements.size() < 2) {
        return numeric_limits<int>::max(); // Return a special value to indicate None
    }

    // Return the second smallest element
    return sorted_elements[1];
}


