using namespace std;

bool check_dict_case(map<string, string> dict) {
    if (dict.empty()) {
        return false;
    }

    bool isLower = false;
    bool isUpper = false;
    bool isMixed = false;

    for (const auto& entry : dict) {
        const string& key = entry.first;

        // Check if the key is a valid string
        if (key.empty()) {
            return false;
        }

        bool keyIsLower = true;
        bool keyIsUpper = true;

        for (char ch : key) {
            if (!isalpha(ch)) {
                return false; // Key contains non-alphabetic characters
            }
            if (islower(ch)) {
                keyIsUpper = false;
            } else if (isupper(ch)) {
                keyIsLower = false;
            }
        }

        if (keyIsLower && keyIsUpper) {
            continue; // Key is a single character, both lower and upper
        }

        if (keyIsLower) {
            if (isUpper || isMixed) {
                return false;
            }
            isLower = true;
        } else if (keyIsUpper) {
            if (isLower || isMixed) {
                return false;
            }
            isUpper = true;
        } else {
            isMixed = true;
        }
    }

    return isLower || isUpper;
}


#undef NDEBUG
#include<assert.h>
int main(){
    assert (check_dict_case({{"p","pineapple"}, {"b","banana"}}) == true);
    assert (check_dict_case({{"p","pineapple"}, {"A","banana"}, {"B","banana"}}) == false);
    assert (check_dict_case({{"p","pineapple"}, {"5","banana"}, {"a","apple"}}) == false);
    assert (check_dict_case({{"Name","John"}, {"Age","36"}, {"City","Houston"}}) == false);
    assert (check_dict_case({{"STATE","NC"}, {"ZIP","12345"} }) == true  );
    assert (check_dict_case({{"fruit","Orange"}, {"taste","Sweet"} }) == true  );
    assert (check_dict_case({}) == false);
}

