int closest_integer(string value) {
    // Check if the string contains exactly one decimal point
    size_t dot_pos = value.find('.');
    if (dot_pos != string::npos) {
        // Remove trailing zeros
        while (value.back() == '0') {
            value.pop_back();
        }
        // Check if the last two characters are ".5"
        if (value.substr(dot_pos) == ".5") {
            double num = stod(value);
            if (num > 0) {
                return static_cast<int>(ceil(num));
            } else {
                return static_cast<int>(floor(num));
            }
        }
    }

    // Convert the string to a double and round it
    double num = stod(value);
    return static_cast<int>(round(num));
}

