    cout << "closest_integer(\"10\") = " << closest_integer("10") << endl;       // Output: 10
    cout << "closest_integer(\"15.3\") = " << closest_integer("15.3") << endl;   // Output: 15
    cout << "closest_integer(\"14.5\") = " << closest_integer("14.5") << endl;   // Output: 15
    cout << "closest_integer(\"-14.5\") = " << closest_integer("-14.5") << endl; // Output: -15
}


