string rounded_avg(int n, int m) {
    if (m < n) {
        return "-1";
    }

    long long summation = 0;
    for (int i = n; i <= m; ++i) {
        summation += i;
    }

    int count = m - n + 1;
    double average = static_cast<double>(summation) / count;
    int rounded_average = floor(average + 0.5);

    string binary_representation = bitset<32>(rounded_average).to_string();
    // Remove leading zeros
    size_t first_one = binary_representation.find('1');
    if (first_one != string::npos) {
        binary_representation = binary_representation.substr(first_one);
    }

    return binary_representation;
}


