        int x = 1;
        if (i % 2 == 0) {
            // Calculate factorial of i
            for (int j = 1; j <= i; ++j) {
                x *= j;
            }
        } else {
            // Calculate sum of numbers from 1 to i
            x = 0;
            for (int j = 1; j <= i; ++j) {
                x += j;
            }
        }
        ret.push_back(x);
    }
    return ret;
}


