// Helper function to calculate the sum of digits of a number
int digits_sum(int n) {
    bool is_negative = n < 0;
    if (is_negative) n = -n;

    int sum = 0;
    string num_str = to_string(n);

    if (is_negative) {
        sum += (num_str[0] - '0') * -1;
        for (size_t i = 1; i < num_str.length(); ++i) {
            sum += (num_str[i] - '0');
        }
    } else {
        for (char digit : num_str) {
            sum += (digit - '0');
        }
    }

    return sum;
}

// Main function to count the number of elements with a sum of digits > 0
int count_nums(vector<int> n) {
    int count = 0;
    for (int num : n) {
        if (digits_sum(num) > 0) {
            count++;
        }
    }
    return count;
}

