map<char, int> histogram(string test) {
    map<char, int> freq;
    map<char, int> result;
    int max_count = 0;

    // Count the frequency of each letter
    stringstream ss(test);
    string letter;
    while (ss >> letter) {
        char ch = letter[0]; // Extract the character from the string
        freq[ch]++;
        max_count = max(max_count, freq[ch]);
    }

    // Find letters with the maximum frequency
    for (const auto& pair : freq) {
        if (pair.second == max_count) {
            result[pair.first] = pair.second;
        }
    }

    return result;
}

// Function to test the histogram function
void test_histogram() {
    assert(histogram("a b c") == (map<char, int>{{'a', 1}, {'b', 1}, {'c', 1}}));
    assert(histogram("a b b a") == (map<char, int>{{'a', 2}, {'b', 2}}));
    assert(histogram("a b c a b") == (map<char, int>{{'a', 2}, {'b', 2}}));
    assert(histogram("b b b b a") == (map<char, int>{{'b', 4}}));
    assert(histogram("") == (map<char, int>{}));
    cout << "All tests passed!" << endl;
}


