bool move_one_ball(vector<int> arr) {
    if (arr.empty()) {
        return true;
    }

    vector<int> sorted_arr = arr;
    sort(sorted_arr.begin(), sorted_arr.end());

    int min_value = *min_element(arr.begin(), arr.end());
    int min_index = find(arr.begin(), arr.end(), min_value) - arr.begin();

    vector<int> shifted_arr(arr.size());
    for (int i = 0; i < arr.size(); ++i) {
        shifted_arr[i] = arr[(i + min_index) % arr.size()];
    }

    return shifted_arr == sorted_arr;
}

