vector<string> by_length(vector<int> arr) {
    // Define the mapping from integers to their corresponding names
    map<int, string> digit_to_name = {
        {1, "One"},
        {2, "Two"},
        {3, "Three"},
        {4, "Four"},
        {5, "Five"},
        {6, "Six"},
        {7, "Seven"},
        {8, "Eight"},
        {9, "Nine"}
    };

    // Filter and sort the valid integers (1-9) in descending order
    vector<int> valid_integers;
    for (int num : arr) {
        if (num >= 1 && num <= 9) {
            valid_integers.push_back(num);
        }
    }
    sort(valid_integers.rbegin(), valid_integers.rend());

    // Convert the sorted integers to their corresponding names
    vector<string> result;
    for (int num : valid_integers) {
        result.push_back(digit_to_name[num]);
    }

    return result;
}


