vector<string> reverse_delete(string s, string c) {
    // Step 1: Filter out characters in s that are present in c
    string filtered_s;
    for (char ch : s) {
        if (c.find(ch) == string::npos) {
            filtered_s += ch;
        }
    }

    // Step 2: Check if the filtered string is a palindrome
    string reversed_s = filtered_s;
    reverse(reversed_s.begin(), reversed_s.end());
    bool is_palindrome = (filtered_s == reversed_s);

    // Step 3: Prepare the result vector
    vector<string> result;
    result.push_back(filtered_s);
    result.push_back(is_palindrome ? "True" : "False");

    return result;
}

// Function to test the reverse_delete function
void test_reverse_delete() {
    vector<string> result1 = reverse_delete("abcde", "ae");
    cout << "(" << result1[0] << ", " << result1[1] << ")" << endl; // Expected: (bcd, False)

    vector<string> result2 = reverse_delete("abcdef", "b");
    cout << "(" << result2[0] << ", " << result2[1] << ")" << endl; // Expected: (acdef, False)

    vector<string> result3 = reverse_delete("abcdedcba", "ab");
    cout << "(" << result3[0] << ", " << result3[1] << ")" << endl; // Expected: (cdedc, True)
}


