long long minSubArraySum(vector<long long> nums) {
    long long min_sum = LLONG_MAX; // Initialize min_sum to the largest possible long long value
    long long current_sum = 0; // Initialize current_sum to 0

    for (long long num : nums) {
        current_sum = min(num, current_sum + num); // Update current_sum to the minimum of num and current_sum + num
        min_sum = min(min_sum, current_sum); // Update min_sum to the minimum of min_sum and current_sum
    }

    return min_sum; // Return the minimum sum of any non-empty sub-vector
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (minSubArraySum({2, 3, 4, 1, 2, 4}) == 1);
    assert (minSubArraySum({-1, -2, -3}) == -6);
    assert (minSubArraySum({-1, -2, -3, 2, -10}) == -14);
    assert (minSubArraySum({-9999999999999999}) == -9999999999999999);
    assert (minSubArraySum({0, 10, 20, 1000000}) == 0);
    assert (minSubArraySum({-1, -2, -3, 10, -5}) == -6);
    assert (minSubArraySum({100, -1, -2, -3, 10, -5}) == -6);
    assert (minSubArraySum({10, 11, 13, 8, 3, 4}) == 3);
    assert (minSubArraySum({100, -33, 32, -1, 0, -2}) == -33);
    assert (minSubArraySum({-10}) == -10);
    assert (minSubArraySum({7}) == 7);
    assert (minSubArraySum({1, -1}) == -1);
}

