int max_fill(vector<vector<int>> grid, int capacity) {
    int total_operations = 0;
    for (const auto& well : grid) {
        int water_units = 0;
        for (int unit : well) {
            water_units += unit;
        }
        total_operations += ceil(static_cast<double>(water_units) / capacity);
    }
    return total_operations;
}

