bool is_vowel(char c) {
    c = tolower(c);
    return c == 'a' || c == 'e' || c == 'i' || c == 'o' || c == 'u';
}

vector<string> select_words(string s, int n) {
    vector<string> result;
    stringstream ss(s);
    string word;

    while (ss >> word) {
        int n_consonants = 0;
        for (char c : word) {
            if (!is_vowel(c)) {
                n_consonants++;
            }
        }
        if (n_consonants == n) {
            result.push_back(word);
        }
    }

    return result;
}

// Function to test the select_words function
void test_select_words() {
    vector<string> result1 = select_words("Mary had a little lamb", 4);
    vector<string> expected1 = {"little"};
    assert(result1 == expected1);

    vector<string> result2 = select_words("Mary had a little lamb", 3);
    vector<string> expected2 = {"Mary", "lamb"};
    assert(result2 == expected2);

    vector<string> result3 = select_words("simple white space", 2);
    vector<string> expected3 = {};
    assert(result3 == expected3);

    vector<string> result4 = select_words("Hello world", 4);
    vector<string> expected4 = {"world"};
    assert(result4 == expected4);

    vector<string> result5 = select_words("Uncle sam", 3);
    vector<string> expected5 = {"Uncle"};
    assert(result5 == expected5);

    cout << "All tests passed!" << endl;
}


