vector<string> split_words(string txt) {
    // Check for whitespace
    if (txt.find(' ') != string::npos) {
        stringstream ss(txt);
        vector<string> words;
        string word;
        while (ss >> word) {
            words.push_back(word);
        }
        return words;
    }
    // Check for commas
    else if (txt.find(',') != string::npos) {
        replace(txt.begin(), txt.end(), ',', ' ');
        stringstream ss(txt);
        vector<string> words;
        string word;
        while (ss >> word) {
            words.push_back(word);
        }
        return words;
    }
    // Count lowercase letters with odd order
    else {
        int count = 0;
        for (char c : txt) {
            if (islower(c) && ((c - 'a') % 2 == 1)) {
                count++;
            }
        }
        return {to_string(count)};
    }
}

