vector<int> get_odd_collatz(int n) {
    vector<int> odd_collatz;

    // If n is odd, add it to the list
    if (n % 2 == 1) {
        odd_collatz.push_back(n);
    }

    // Generate the Collatz sequence and collect odd numbers
    while (n > 1) {
        if (n % 2 == 0) {
            n = n / 2;
        } else {
            n = n * 3 + 1;
            if (n % 2 == 1) {
                odd_collatz.push_back(n);
            }
        }
    }

    // Sort the list of odd numbers
    sort(odd_collatz.begin(), odd_collatz.end());

    return odd_collatz;
}


