int prod_signs(vector<int> arr) {
    if (arr.empty()) {
        return -32768;
    }

    int sign_product = 1;
    int magnitude_sum = 0;

    for (int num : arr) {
        if (num == 0) {
            sign_product = 0;
            break;
        } else if (num < 0) {
            sign_product *= -1;
        }
        magnitude_sum += abs(num);
    }

    return sign_product * magnitude_sum;
}

