// Function to find the minimum path of length k in the grid
vector<int> minPath(vector<vector<int>> grid, int k) {
    int n = grid.size();
    vector<pair<int, int>> directions = {{0, 1}, {1, 0}, {0, -1}, {-1, 0}};

    // Priority queue to store (path, current_position)
    auto cmp = [](const tuple<vector<int>, int, int>& a, const tuple<vector<int>, int, int>& b) {
        return vector<int>(get<0>(a)) > vector<int>(get<0>(b));
    };
    priority_queue<tuple<vector<int>, int, int>, vector<tuple<vector<int>, int, int>>, decltype(cmp)> pq(cmp);

    // Initialize the priority queue with all possible starting points
    for (int i = 0; i < n; ++i) {
        for (int j = 0; j < n; ++j) {
            pq.push({{grid[i][j]}, i, j});
        }
    }

    while (!pq.empty()) {
        auto [path, x, y] = pq.top();
        pq.pop();

        // If the path length is k, return the path
        if (path.size() == k) {
            return path;
        }

        // Explore all possible moves
        for (auto& [dx, dy] : directions) {
            int nx = x + dx, ny = y + dy;
            if (0 <= nx && nx < n && 0 <= ny && ny < n) {
                vector<int> new_path = path;
                new_path.push_back(grid[nx][ny]);
                pq.push({new_path, nx, ny});
            }
        }
    }

    return {};
}


