bool is_nested(string str) {
    vector<int> opening_bracket_index;
    vector<int> closing_bracket_index;

    // Collect indices of opening and closing brackets
    for (int i = 0; i < str.length(); ++i) {
        if (str[i] == '[') {
            opening_bracket_index.push_back(i);
        } else {
            closing_bracket_index.push_back(i);
        }
    }

    // Reverse the closing bracket indices
    reverse(closing_bracket_index.begin(), closing_bracket_index.end());

    int cnt = 0;
    int i = 0;
    int l = closing_bracket_index.size();

    // Count nested pairs
    for (int idx : opening_bracket_index) {
        if (i < l && idx < closing_bracket_index[i]) {
            cnt += 1;
            i += 1;
        }
    }

    // Return true if there is at least one nested pair
    return cnt >= 2;
}

