bool check_if_last_char_is_a_letter(string txt) {
    // Remove trailing spaces
    while (!txt.empty() && txt.back() == ' ') {
        txt.pop_back();
    }

    // Check if the string is empty after removing trailing spaces
    if (txt.empty()) {
        return false;
    }

    // Find the last non-space character
    int last_char_index = txt.size() - 1;

    // Check if the last character is a single alphabetical character
    if (isalpha(txt[last_char_index])) {
        // Check if the character before the last character is a space
        if (last_char_index == 0 || txt[last_char_index - 1] == ' ') {
            return true;
        }
    }

    return false;
}

