string file_name_check(string file_name) {
    vector<string> valid_extensions = {"txt", "exe", "dll"};

    // Find the position of the dot
    size_t dot_pos = file_name.find('.');

    // Check if there is exactly one dot
    if (dot_pos == string::npos || file_name.find('.', dot_pos + 1) != string::npos) {
        return "No";
    }

    // Split the file name into name and extension
    string name_part = file_name.substr(0, dot_pos);
    string extension_part = file_name.substr(dot_pos + 1);

    // Check if the name part is non-empty and starts with a letter
    if (name_part.empty() || !isalpha(name_part[0])) {
        return "No";
    }

    // Check if the extension part is valid
    bool is_valid_extension = false;
    for (const string& ext : valid_extensions) {
        if (extension_part == ext) {
            is_valid_extension = true;
            break;
        }
    }
    if (!is_valid_extension) {
        return "No";
    }

    // Count the number of digits in the name part
    int digit_count = 0;
    for (char ch : name_part) {
        if (isdigit(ch)) {
            digit_count++;
        }
    }
    if (digit_count > 3) {
        return "No";
    }

    // If all conditions are met, return "Yes"
    return "Yes";
}

