int sum_squares(vector<int> lst) {
    int sum = 0;
    for (size_t i = 0; i < lst.size(); ++i) {
        if (i % 3 == 0) {
            sum += lst[i] * lst[i]; // Square the element if index is a multiple of 3
        } else if (i % 4 == 0 && i % 3 != 0) {
            sum += lst[i] * lst[i] * lst[i]; // Cube the element if index is a multiple of 4 but not 3
        } else {
            sum += lst[i]; // Leave the element unchanged otherwise
        }
    }
    return sum;
}

