bool simplify(string x, string n) {
    // Split the fractions into numerator and denominator
    size_t slash_pos_x = x.find('/');
    size_t slash_pos_n = n.find('/');

    int a = stoi(x.substr(0, slash_pos_x));
    int b = stoi(x.substr(slash_pos_x + 1));
    int c = stoi(n.substr(0, slash_pos_n));
    int d = stoi(n.substr(slash_pos_n + 1));

    // Calculate the product of the numerators and denominators
    int numerator = a * c;
    int denom = b * d;

    // Check if the result is a whole number
    if (numerator % denom == 0) {
        return true;
    }
    return false;
}

// Function to test the simplify function
void test_simplify() {
    cout << (simplify("1/5", "5/1") ? "true" : "false") << endl; // true
    cout << (simplify("1/6", "2/1") ? "true" : "false") << endl; // false
    cout << (simplify("7/10", "10/2") ? "true" : "false") << endl; // false
}


