int get_max_triples(int n) {
    // Generate the sequence A
    vector<int> A(n);
    for (int i = 1; i <= n; ++i) {
        A[i-1] = i * i - i + 1;
    }

    // Initialize the count of valid triples
    int count = 0;

    // Triple nested loop to check all combinations of i, j, k
    for (int i = 0; i < n; ++i) {
        for (int j = i + 1; j < n; ++j) {
            for (int k = j + 1; k < n; ++k) {
                if ((A[i] + A[j] + A[k]) % 3 == 0) {
                    count++;
                }
            }
        }
    }

    return count;
}


#undef NDEBUG
#include<assert.h>
int main(){
    assert (get_max_triples(5) == 1);
    assert (get_max_triples(6) == 4);
    assert (get_max_triples(10) == 36);
    assert (get_max_triples(100) == 53361);
}

