// Helper function to calculate the sum of digits of an integer
int digits_sum(int n) {
    bool is_negative = false;
    if (n < 0) {
        n = -n;
        is_negative = true;
    }
    int sum = 0;
    string num_str = to_string(n);
    if (is_negative) {
        sum -= (num_str[0] - '0');
    } else {
        sum += (num_str[0] - '0');
    }
    for (size_t i = 1; i < num_str.length(); ++i) {
        sum += (num_str[i] - '0');
    }
    return sum;
}

// Comparator function to sort based on the sum of digits
bool compare(const pair<int, int>& a, const pair<int, int>& b) {
    int sum_a = digits_sum(a.first);
    int sum_b = digits_sum(b.first);
    if (sum_a == sum_b) {
        return a.second < b.second; // Maintain original order if sums are equal
    }
    return sum_a < sum_b;
}

vector<int> order_by_points(vector<int> nums) {
    vector<pair<int, int>> indexed_nums;
    for (int i = 0; i < nums.size(); ++i) {
        indexed_nums.push_back({nums[i], i});
    }
    sort(indexed_nums.begin(), indexed_nums.end(), compare);
    vector<int> sorted_nums;
    for (const auto& p : indexed_nums) {
        sorted_nums.push_back(p.first);
    }
    return sorted_nums;
}


