int x_or_y(int n, int x, int y) {
    // Special case: 1 is not a prime number
    if (n == 1) {
        return y;
    }

    // Check for factors from 2 to n-1
    for (int i = 2; i < n; ++i) {
        if (n % i == 0) {
            return y;
        }
    }

    // If no factors were found, n is a prime number
    return x;
}

// Function to test the x_or_y function
void test_x_or_y() {
    printf("x_or_y(7, 34, 12) = %d\n", x_or_y(7, 34, 12)); // Should print 34
    printf("x_or_y(15, 8, 5) = %d\n", x_or_y(15, 8, 5));   // Should print 5
}


