vector<string> bf(string planet1, string planet2) {
    // Define the order of the planets
    const vector<string> planet_names = {"Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"};

    // Check if both planet names are valid
    if (find(planet_names.begin(), planet_names.end(), planet1) == planet_names.end() ||
        find(planet_names.begin(), planet_names.end(), planet2) == planet_names.end() ||
        planet1 == planet2) {
        return {}; // Return an empty vector if either planet name is invalid or they are the same
    }

    // Find the indices of the planets
    int planet1_index = find(planet_names.begin(), planet_names.end(), planet1) - planet_names.begin();
    int planet2_index = find(planet_names.begin(), planet_names.end(), planet2) - planet_names.begin();

    // Ensure planet1_index is less than planet2_index
    if (planet1_index > planet2_index) {
        swap(planet1_index, planet2_index);
    }

    // Create and return the vector of planets between the two given planets
    vector<string> result(planet2_index - planet1_index - 1);
    for (int i = 0; i < result.size(); ++i) {
        result[i] = planet_names[planet1_index + 1 + i];
    }

    return result;
}

// Function to test the bf function
void test_bf() {
    vector<string> result1 = bf("Jupiter", "Neptune");
    vector<string> expected1 = {"Saturn", "Uranus"};
    assert(result1 == expected1);

    vector<string> result2 = bf("Earth", "Mercury");
    vector<string> expected2 = {"Venus"};
    assert(result2 == expected2);

    vector<string> result3 = bf("Mercury", "Uranus");
    vector<string> expected3 = {"Venus", "Earth", "Mars", "Jupiter", "Saturn"};
    assert(result3 == expected3);

    vector<string> result4 = bf("Pluto", "Neptune"); // Invalid planet name
    vector<string> expected4 = {};
    assert(result4 == expected4);

    cout << "All tests passed!" << endl;
}


