vector<string> sorted_list_sum(vector<string> lst) {
    // Step 1: Sort the list alphabetically
    sort(lst.begin(), lst.end());

    // Step 2: Filter out strings with odd lengths
    vector<string> new_lst;
    for (const string& s : lst) {
        if (s.length() % 2 == 0) {
            new_lst.push_back(s);
        }
    }

    // Step 3: Sort the filtered list by length
    sort(new_lst.begin(), new_lst.end(), [](const string& a, const string& b) {
        if (a.length() == b.length()) {
            return a < b; // Alphabetical order for strings of the same length
        }
        return a.length() < b.length();
    });

    return new_lst;
}

// Function to test the solution
