vector<int> even_odd_count(int num) {
    int even_count = 0;
    int odd_count = 0;
    num = abs(num); // Convert to absolute value to handle negative numbers

    while (num > 0) {
        int digit = num % 10; // Extract the last digit
        if (digit % 2 == 0) {
            even_count++; // Increment even count if the digit is even
        } else {
            odd_count++; // Increment odd count if the digit is odd
        }
        num /= 10; // Remove the last digit
    }

    return {even_count, odd_count}; // Return the counts as a vector
}


