        int unique_a = set<char>(a.begin(), a.end()).size();
        int unique_b = set<char>(b.begin(), b.end()).size();
        if (unique_a == unique_b) {
            return a < b; // Lexicographical order
        }
        return unique_a > unique_b; // More unique characters first
    };

    // Sort the words using the custom comparator
    sort(words.begin(), words.end(), comp);

    // Return the first word in the sorted list
    return words.front();
}

