using namespace std;

string solve(string s) {
    bool hasLetter = false;
    string result = s;

    // Iterate through the string and process each character
    for (size_t i = 0; i < s.length(); ++i) {
        if (isalpha(s[i])) {
            hasLetter = true;
            if (islower(s[i])) {
                result[i] = toupper(s[i]);
            } else {
                result[i] = tolower(s[i]);
            }
        }
    }

    // If no letters were found, reverse the string
    if (!hasLetter) {
        reverse(result.begin(), result.end());
    }

    return result;
}

// Function to test the solve function
void test_solve() {
    cout << "solve(\"1234\") = " << solve("1234") << endl; // Expected: "4321"
    cout << "solve(\"ab\") = " << solve("ab") << endl;     // Expected: "AB"
    cout << "solve(\"#a@C\") = " << solve("#a@C") << endl; // Expected: "#A@c"
}


