vector<int> generate_integers(int a, int b) {
    // Ensure the lower bound is at least 2 and the upper bound is at most 8
    int lower = max(2, min(a, b));
    int upper = min(8, max(a, b));

    vector<int> result;
    // Generate even digits between lower and upper bounds
    for (int i = lower; i <= upper; i++) {
        if (i % 2 == 0) {
            result.push_back(i);
        }
    }

    return result;
}

